import React from "react";
import { View, Text, TextInput, Button } from "react-native";

export default function Editar() {
  return (
    <View>
      <Text>Editar Page</Text>
      <View>
        {/* DIV TÍTULO */}
        <View>
          <Text style={{ fontSize: 25 }}>Título</Text>
          <TextInput placeholder="  Minha Bela Imagem"></TextInput>
        </View>

        {/* DIV IMAGEM */}
        <View>
          <Text style={{ fontSize: 25 }}>URL da imagem</Text>
          <TextInput placeholder="  https://www.google.com"></TextInput>
        </View>

        {/* DIV DESCRIÇÃO */}
        <View>
          <Text style={{ fontSize: 25 }}>Descrição</Text>
          <TextInput></TextInput>
        </View>
        <Button title="Editar"/>
      </View>
    </View>
  );
}
